import React, { Component } from "react";
import { AuthTopBar } from "../constants.js";

class Admin extends Component {
	constructor() {
		super();
		this.state = {
			users: ""
		};
	}

	render() {
		return (
			<div className="valign-wrapper">
				<img
					alt=""
					className="container-background"
					src="images/background.jpg"
				/>
				<AuthTopBar />
			</div>
		);
	}
}
